Tyring [e0e53f9](https://github.com/Petro31/media_player.template/commit/e0e53f9bcb3d453f1a26245654378666dcafd3ab)

I tried no else clause to make it return an empty string when there's no content, thinking None might get converted to string "None", which is also not a valid media content type;

```
        media_content_type_template: |-
          {%- if is_state("sensor.avr_source", "Google TV") -%} 
            music
          {%- elif is_state("sensor.avr_source", "FM Tuner") -%}
            music
          {%- elif state_attr('media_player.str_dn1080_googlecast', 'media_content_type') is not none -%} 
            {{ state_attr('media_player.str_dn1080_googlecast', 'media_content_type') }}
          {%- endif -%}
```
But that didn't work:
```
Template entity media_player.str_dn1080_template received an invalid media content type , expected: album, app, apps, artist, channel, channels, composer, contributing_artist, episode, game, genre, image, movie, music, playlist, podcast, season, track, tvshow, url, video
```

So I tried None like you suggested and that took care of that problem.
